import React from 'react';
import Header from './Header';
import Sidebar from './Sidebar';
import Emaillist from './Emaillist';
import Emailtype from './Emailtype';
function App() {
  return (
    <div className="App">
      <Header/>
      <div className='app_body'>

        <Sidebar/>
        <Emaillist/>
        <Emailtype/>
      </div>

    </div>
  );
}

export default App;
